# Muchility Main Window

Function Muchility-Window {
    Add-Type -AssemblyName System.Windows.Forms
    Add-Type -AssemblyName System.Drawing

    $buttonWidth = 120
    $buttonHeight = 40
    $paddingX = 20
    $paddingY = 20
    $columns = 3
    $rows = 4

    $formWidth = 445
    $formHeight = 320
    
    $form = New-Object System.Windows.Forms.Form
    $form.Size = New-Object System.Drawing.Size($formWidth, $formHeight)
    $form.Icon = MuchilityIcon
    $form.BackColor = [System.Drawing.Color]::FromArgb(32, 33, 36)
    $form.Text = $muchititle

    $form.FormBorderStyle = [System.Windows.Forms.FormBorderStyle]::FixedDialog
    $form.MaximizeBox = $false
    $form.MinimizeBox = $false
    $form.StartPosition = [System.Windows.Forms.FormStartPosition]::CenterScreen

    Function Add-Button {
        param (
            [string]$text,
            [int]$x,
            [int]$y,
            [scriptblock]$function,
            [string]$tooltipText
        )
        
        $button = New-Object System.Windows.Forms.Button
        $button.Text = $text
        $button.Size = New-Object System.Drawing.Size($buttonWidth, $buttonHeight)
        $button.Location = New-Object System.Drawing.Point($x, $y)
        $button.FlatStyle = [System.Windows.Forms.FlatStyle]::Flat
        $button.FlatAppearance.BorderSize = 0

        $button.BackColor = [System.Drawing.Color]::FromArgb(60, 64, 67)
        $button.ForeColor = [System.Drawing.Color]::white

        $button.Add_Click($function)

        $tooltip = New-Object System.Windows.Forms.ToolTip
        $tooltip.SetToolTip($button, $tooltipText)

        $form.Controls.Add($button)
    }

    $muchiButtons = @(
        @{ Name = "Create Restore Point"; Function = { Restore-Button } ; Tooltip = "Create " + '"Before Muchility" ' + "Restore Point" },
        @{ Name = "Apply Tweaks"; Function = { Apply-Tweaks-Button } ; Tooltip = "Open Tweak Selection" },
        @{ Name = "Extra Tweaks/Apps"; Function = { Extra-Button } ; Tooltip = "Download Extra Tweaks Pack" },
        @{ Name = "Activate Windows"; Function = { Activate-Win } ; Tooltip = "Activate Windows 10/11" },
        @{ Name = "Upgrade Windows"; Function = { Upgrade-Win-Button } ; Tooltip = "Upgrade Windows 10/11 (Example = Home --> Pro)" },
        @{ Name = "Debloat Windows"; Function = { Debloater-Button } ; Tooltip = "Removes *MOST* Microsoft Bloatware Apps" },
        @{ Name = "Clear Temp"; Function = { Clear-Temp-Button } ; Tooltip = "Clear Temporary Files" },
        @{ Name = "Repair System"; Function = { Repair-System-Button } ; Tooltip = "Repair System Files" },
        @{ Name = "Update All Apps"; Function = { Update-Apps-Button } ; Tooltip = "Updates All Installed Apps" },
        @{ Name = "Windows Update"; Function = { Windows-Update-Button } ; Tooltip = "Configure Windows Update" },
        @{ Name = "Discord"; Function = { Discord-Button } ; Tooltip = "Discord Invite (Ignorance)" },
        @{ Name = "Source Code"; Function = { Source-Button } ; Tooltip = "Muchility Source Code" }
    )

    for ($i = 0; $i -lt $muchiButtons.Count; $i++) {
        $col = $i % $columns
        $row = [math]::Floor($i / $columns)
        $x = ($col * ($buttonWidth + $paddingX)) + $paddingX
        $y = ($row * ($buttonHeight + $paddingY)) + $paddingY

        $button = $muchiButtons[$i]
        Add-Button -text $button.Name -x $x -y $y -function $button.Function -tooltipText $button.Tooltip
    }

    $statusLabel = New-Object System.Windows.Forms.Label
	$statusLabel.Text = $UpdateMSG
	$statusLabel.Size = New-Object System.Drawing.Size($formWidth, 30)
	$statusLabel.Location = New-Object System.Drawing.Point(0, 250)
	$statusLabel.ForeColor = [System.Drawing.Color]::FromArgb(57, 255, 20)
	$statusLabel.TextAlign = [System.Drawing.ContentAlignment]::MiddleCenter
	$statusLabel.BorderStyle = [System.Windows.Forms.BorderStyle]::None
	$form.Controls.Add($statusLabel)

    [void]$form.ShowDialog()
}


# Tweaks Window

Function Tweaks-Window {
    Add-Type -AssemblyName System.Windows.Forms
    Add-Type -AssemblyName System.Drawing

    $checkboxWidth = 180
    $checkboxHeight = 25

    $formWidth = 230
    $formHeight = 420

    $form = New-Object System.Windows.Forms.Form
    $form.Size = New-Object System.Drawing.Size($formWidth, $formHeight)
    $form.Icon = MuchilityIcon
    $form.BackColor = [System.Drawing.Color]::FromArgb(32, 33, 36)
    $form.Text = $muchititle
    $form.FormBorderStyle = [System.Windows.Forms.FormBorderStyle]::FixedDialog
    $form.MaximizeBox = $false
    $form.MinimizeBox = $false
    $form.StartPosition = [System.Windows.Forms.FormStartPosition]::CenterScreen

    Function Add-Checkbox {
        param (
            [string]$text,
            [int]$x,
            [int]$y
        )
        
        $checkbox = New-Object System.Windows.Forms.CheckBox
        $checkbox.Text = $text
        $checkbox.Size = New-Object System.Drawing.Size($checkboxWidth, $checkboxHeight)
        $checkbox.Location = New-Object System.Drawing.Point($x, $y)
        $checkbox.FlatStyle = [System.Windows.Forms.FlatStyle]::Flat
        $checkbox.BackColor = [System.Drawing.Color]::FromArgb(32, 33, 36)  # Transparent background
        $checkbox.ForeColor = [System.Drawing.Color]::White

        $form.Controls.Add($checkbox)
        return $checkbox
    }

    # Creating checkboxes manually
    $checkboxes = @()
    $checkboxes += Add-Checkbox -text "Delete OneDrive" -x 20 -y 10
    $checkboxes += Add-Checkbox -text "Disable Wi-Fi Sense" -x 20 -y 40
    $checkboxes += Add-Checkbox -text "Disable Windows Ads" -x 20 -y 70
    $checkboxes += Add-Checkbox -text "DVR Tweaks" -x 20 -y 100
    $checkboxes += Add-Checkbox -text "Enable Game Mode" -x 20 -y 130
    $checkboxes += Add-Checkbox -text "Keyboard + Mouse Tweaks" -x 20 -y 160
    $checkboxes += Add-Checkbox -text "Muchi Power Plan" -x 20 -y 190
    $checkboxes += Add-Checkbox -text "Optimize Services" -x 20 -y 220
    $checkboxes += Add-Checkbox -text "Performance Tweaks" -x 20 -y 250
    $checkboxes += Add-Checkbox -text "Scheduled Tasks" -x 20 -y 280
    $checkboxes += Add-Checkbox -text "Take Ownership" -x 20 -y 310

    # Create Apply button
    $applyButton = New-Object System.Windows.Forms.Button
    $applyButton.Text = "Apply Selected"
    $applyButton.Size = New-Object System.Drawing.Size($checkboxWidth, 30)  # Bigger size for the Apply button
    $applyButton.Location = New-Object System.Drawing.Point(20, 340)
    $applyButton.BackColor = [System.Drawing.Color]::FromArgb(60, 64, 67)
    $applyButton.ForeColor = [System.Drawing.Color]::White
    $applyButton.FlatStyle = [System.Windows.Forms.FlatStyle]::Flat
    $applyButton.FlatAppearance.BorderSize = 0

    $applyButton.Add_Click({
        # Iterate over checkboxes and call function if checked
        if ($checkboxes[0].Checked) { TwOneDrive }
        if ($checkboxes[1].Checked) { TwWiFiSense }
        if ($checkboxes[2].Checked) { TwAds }
        if ($checkboxes[3].Checked) { TwDVR }
        if ($checkboxes[4].Checked) { TwGameMode }
        if ($checkboxes[5].Checked) { TwKBM }
        if ($checkboxes[6].Checked) { TwMuchiPowerPlan }
        if ($checkboxes[7].Checked) { TwServices }
        if ($checkboxes[8].Checked) { TwPerformance }
        if ($checkboxes[9].Checked) { TwScheduledTasks }
        if ($checkboxes[10].Checked) { TwOwnershipContext }
    })

    $form.Controls.Add($applyButton)

    [void]$form.ShowDialog()
}


# Windows Update Window

Function Windows-Update-Window {
    Add-Type -AssemblyName System.Windows.Forms

    $buttonWidth = 120
    $buttonHeight = 40
    $paddingX = 20
    $paddingY = 20
    $columns = 1
    $rows = 3

    $formWidth = 165
    $formHeight = 230

    $form = New-Object System.Windows.Forms.Form
    $form.Text = "Muchility " + $muchiver
    $form.Size = New-Object System.Drawing.Size($formWidth, $formHeight)
	$form.Icon = MuchilityIcon
	$form.BackColor = [System.Drawing.Color]::FromArgb(32, 33, 36)

    $form.FormBorderStyle = [System.Windows.Forms.FormBorderStyle]::FixedDialog
    $form.MaximizeBox = $false
    $form.MinimizeBox = $false
    $form.StartPosition = [System.Windows.Forms.FormStartPosition]::CenterScreen

    Function Add-Button {
        param (
            [string]$text,
            [int]$x,
            [int]$y,
            [scriptblock]$function
        )
        $button = New-Object System.Windows.Forms.Button
        $button.Text = $text
        $button.Size = New-Object System.Drawing.Size(120, 40)
        $button.Location = New-Object System.Drawing.Point($x, $y)
        $button.FlatStyle = [System.Windows.Forms.FlatStyle]::Flat
        $button.FlatAppearance.BorderSize = 0
        $button.BackColor = [System.Drawing.Color]::FromArgb(60, 64, 67)
        $button.ForeColor = [System.Drawing.Color]::white

        $button.Add_Click($function)
        $form.Controls.Add($button)
    }

    $updateButtons = @(
        @{ Name = "Enable"; Function = { WinUp-Reset } },
        @{ Name = "Disable"; Function = { WinUp-Dis } },
        @{ Name = "Security Only"; Function = { WinUp-Sec } }
    )

    for ($i = 0; $i -lt $updateButtons.Count; $i++) {
        $col = $i % $columns
        $row = [math]::Floor($i / $columns)
        $x = ($col * ($buttonWidth + $paddingX)) + $paddingX
        $y = ($row * ($buttonHeight + $paddingY)) + $paddingY

        $button = $updateButtons[$i]
        Add-Button -text $button.Name -x $x -y $y -function $button.Function
    }

    [void]$form.ShowDialog()
}


#Tweaks + RunAll

Function TwOneDrive {
Get-ChildItem "$env:SystemDrive\Users" | ForEach-Object {
    if (Test-Path "$($_.FullName)\OneDrive") {
        if ((Get-ChildItem "$($_.FullName)\OneDrive" -File).Count -gt 0) {
            exit 6000
        }
    }
}

Stop-Process -Name "OneDrive" -Force -ErrorAction SilentlyContinue

$oneDrivePaths = @(
    "$env:windir\System32\OneDriveSetup.exe",
    "$env:windir\SysWOW64\OneDriveSetup.exe"
)

foreach ($path in $oneDrivePaths) {
    if (Test-Path $path) {
        & $path /uninstall | Out-Null
    }
}

Get-ChildItem "HKU:\" | Where-Object { $_.Name -match 'S-.*' -or $_.Name -match 'AME_UserHive_[^_]*' } | ForEach-Object {
    $userKey = $_.Name
    $volEnvKey = "HKU\$userKey\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\BannerStore"
    if (Test-Path $volEnvKey) {
        Remove-ItemProperty -Path "HKU\$userKey\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\BannerStore" -Name "OneDrive" -Force -ErrorAction SilentlyContinue
        Remove-ItemProperty -Path "HKU\$userKey\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\AutoplayHandlers\Handlers" -Name "OneDrive" -Force -ErrorAction SilentlyContinue
        Remove-ItemProperty -Path "HKU\$userKey\SOFTWARE\Microsoft\Windows\CurrentVersion\App Paths" -Name "OneDrive" -Force -ErrorAction SilentlyContinue
        Remove-ItemProperty -Path "HKU\$userKey\SOFTWARE\Microsoft\Windows\CurrentVersion\Uninstall" -Name "OneDrive" -Force -ErrorAction SilentlyContinue
    }
}

Remove-Item -Path "$env:ProgramData\Microsoft\OneDrive" -Recurse -Force -ErrorAction SilentlyContinue
Remove-Item -Path "$env:LOCALAPPDATA\Microsoft\OneDrive" -Recurse -Force -ErrorAction SilentlyContinue

Get-ChildItem "$env:SystemDrive\Users" | ForEach-Object {
    Remove-Item -Path "$($_.FullName)\AppData\Local\Microsoft\OneDrive" -Recurse -Force -ErrorAction SilentlyContinue
    Remove-Item -Path "$($_.FullName)\OneDrive" -Recurse -Force -ErrorAction SilentlyContinue
    Remove-Item -Path "$($_.FullName)\AppData\Roaming\Microsoft\Windows\Start Menu\Programs\OneDrive.lnk" -Force -ErrorAction SilentlyContinue
}

Get-ChildItem "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\SyncRootManager" | Where-Object { $_.Name -like "*OneDrive*" } | ForEach-Object {
    Remove-Item -Path $_.PSPath -Force -ErrorAction SilentlyContinue
}

Get-ScheduledTask | Where-Object { $_.TaskName -match "OneDrive Reporting Task|OneDrive Standalone Update Task" } | ForEach-Object {
    Unregister-ScheduledTask -TaskName $_.TaskName -Force -ErrorAction SilentlyContinue
}


}

