# Windows Update Buttons

Function WinUp-Sec {
    $WURegistryPath = "HKLM:\SOFTWARE\Policies\Microsoft\Windows\WindowsUpdate"
    $AURegistryPath = "$WURegistryPath\AU"

    if (-not (Test-Path $WURegistryPath)) {
        New-Item -Path $WURegistryPath -Force | Out-Null
    }
    if (-not (Test-Path $AURegistryPath)) {
        New-Item -Path $AURegistryPath -Force | Out-Null
    }

    Set-ItemProperty -Path $WURegistryPath -Name "DeferFeatureUpdates" -Value 1 -Force
    Set-ItemProperty -Path $WURegistryPath -Name "DeferQualityUpdates" -Value 1 -Force
    Set-ItemProperty -Path $WURegistryPath -Name "BranchReadinessLevel" -Value 10 -Force
    Set-ItemProperty -Path $WURegistryPath -Name "DeferQualityUpdatesPeriodInDays" -Value 0 -Force

    Set-ItemProperty -Path $AURegistryPath -Name "NoAutoUpdate" -Value 1 -Force
    Set-ItemProperty -Path $AURegistryPath -Name "AUOptions" -Value 2 -Force

    $DriverPolicyPath = "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\DriverSearching"
    if (-not (Test-Path $DriverPolicyPath)) {
        New-Item -Path $DriverPolicyPath -Force | Out-Null
    }
    Set-ItemProperty -Path $DriverPolicyPath -Name "SearchOrderConfig" -Value 0 -Force

    Start-Process -FilePath "C:\Windows\System32\schtasks.exe" -ArgumentList "/Delete /TN \"\Microsoft\Windows\WindowsUpdate\Automatic App Update\" /F" -NoNewWindow -Wait
}

Function WinUp-Dis {
    Stop-Service -Name wuauserv -Force
    Set-Service -Name wuauserv -StartupType Manual

    $WURegistryPath = "HKLM:\SOFTWARE\Policies\Microsoft\Windows\WindowsUpdate"
    $AURegistryPath = "$WURegistryPath\AU"

    if (-not (Test-Path $WURegistryPath)) {
        New-Item -Path $WURegistryPath -Force | Out-Null
    }
    if (-not (Test-Path $AURegistryPath)) {
        New-Item -Path $AURegistryPath -Force | Out-Null
    }

    Set-ItemProperty -Path $AURegistryPath -Name "NoAutoUpdate" -Value 1 -Force
    Set-ItemProperty -Path $AURegistryPath -Name "AUOptions" -Value 1 -Force
}

Function WinUp-Reset {
	Start-Process powershell.exe -ArgumentList "-NoExit", "-Command", "& { iwr -useb 'https://raw.githubusercontent.com/Muchiiix/Muchility/refs/heads/main/WindowsUpdateReset.ps1' | iex }"
}


# Start Up Functions

Function FF-CheckNet {
    $HostToPing = "8.8.8.8"
    $PingResult = Test-Connection -ComputerName $HostToPing -Count 1 -Quiet

    If (-Not $PingResult) {
        MuchiDMB "No Internet Will Lead To Errors!"
    }
}

Function FF-MuchiUpdateCheck {
    $url = "https://raw.githubusercontent.com/Muchiiix/Muchility/refs/heads/main/muchiver.txt"

    param (
        [string]$muchiver
    )

    if (-not ([System.Net.NetworkInformation.NetworkInterface]::GetIsNetworkAvailable())) {
        return
    }

    try {
        $latestVer = (New-Object System.Net.WebClient).DownloadString($url).Trim()
    } catch {
        return
    }

    try {
        $currentVer = [System.Version]$muchiver
        $onlineVer = [System.Version]$latestVer
    } catch {
        return
    }

    if ($currentVer -lt $onlineVer) {
        MuchiDMB "Update Available! $latestVer"
        try {
            Start-Process powershell -ArgumentList "-NoExit", "-Command", "iwr -useb 'https://mxchi.xyz/exe' | iex"
        } catch {}
    }
}


# Icon Function

Function MuchilityIcon {
    $base64String = ""

    $icoBytes = [Convert]::FromBase64String($base64String)

    $tempFilePath = [System.IO.Path]::GetTempFileName()
    $tempFilePath = [System.IO.Path]::ChangeExtension($tempFilePath, ".ico")

    [System.IO.File]::WriteAllBytes($tempFilePath, $icoBytes)

    $icon = New-Object System.Drawing.Icon($tempFilePath)

    Remove-Item -Path $tempFilePath -Force

    return $icon
}


# Custom Message Box Window

Function MuchiDMB {
    param(
        [string]$message
    )

    $form = New-Object System.Windows.Forms.Form
    $form.Size = New-Object System.Drawing.Size(300, 100)
    $form.StartPosition = [System.Windows.Forms.FormStartPosition]::CenterScreen

    $form.FormBorderStyle = [System.Windows.Forms.FormBorderStyle]::FixedDialog
    $form.MaximizeBox = $false
    $form.MinimizeBox = $false

    $label = New-Object System.Windows.Forms.Label
    $label.Text = $message
    $label.ForeColor = [System.Drawing.Color]::White
    $form.BackColor = [System.Drawing.Color]::FromArgb(32, 33, 36)
    $label.AutoSize = $true
    $label.TextAlign = [System.Drawing.ContentAlignment]::MiddleCenter

    $label.Font = New-Object System.Drawing.Font("Arial", 13)

    $form.Controls.Add($label)
	
	$form.Text = $muchititle

    $form.Add_Shown({
        $label.Location = New-Object System.Drawing.Point(
            [math]::Round(($form.ClientSize.Width - $label.Width) / 2),
            [math]::Round(($form.ClientSize.Height - $label.Height) / 2)
        )
    })

    $form.Add_Resize({
        $label.Location = New-Object System.Drawing.Point(
            [math]::Round(($form.ClientSize.Width - $label.Width) / 2),
            [math]::Round(($form.ClientSize.Height - $label.Height) / 2)
        )
    })

	$form.Icon = MuchilityIcon
    $form.ShowDialog()
}


